package com.paul90317.mcsync.minecraft;

import java.util.HashMap;

public class Profile extends HashMap<String,String> {
    public static Profile mcSync(String versionId){
        Profile temp = new Profile();
        temp.put("gameDir",String.format("%s\\.minecraft\\.mcsync",System.getenv("APPDATA")));
        temp.put("lastVersionId",versionId);
        temp.put("name","Remote Profile");
        temp.put("type","custom");
        temp.put("icon","data:image/png;base64,");
        return temp;
    }
}
